import React, { useState } from 'react';
import '../../css/ResumeCreate.css';
import Navbar from '../../components/Navbar';
import Header from '../../components/Header';
import UserMenubar from '../../components/UserMenubar';

function ResumeCreate() {
    const [selectedJobs, setSelectedJobs] = useState([]);
    const jobOptions = ['웹 백엔드', '웹 프론트엔드', 'iOS', '안드로이드', '하이브리드 앱', '게임 개발', '기타'];

    const handleJobChange = (job) => {
        if (selectedJobs.includes(job)) {
            setSelectedJobs(selectedJobs.filter((selectedJob) => selectedJob !== job));
        } else {
            setSelectedJobs([...selectedJobs, job]);
        }
    };

    return (
        <div className="resume-create-page">
            <div className="header-container">
                <Header />
                <Navbar />
            </div>
            <div className="user-delete-content">
                <div className="user-menubar-container">
                    <UserMenubar />
                </div>

                {/* 직군 선택 */}
                <div className="resume-content">
                    <h3 className="resume-title">직군 선택</h3>
                    <div className="job-selection-container">
                        {jobOptions.map((job) => (
                            <label key={job} className="job-option">
                                <input
                                    type="checkbox"
                                    checked={selectedJobs.includes(job)}
                                    onChange={() => handleJobChange(job)}
                                />
                                {job}
                            </label>
                        ))}
                    </div>

                    <hr />

                    {/* 경력 섹션 */}
                    <h3 className="resume-title">총 경력<span className="fc-danger">*</span></h3>
                    <p className="mb-3" style={{ fontSize: '13px', fontWeight: '300', color: 'var(--bGray1)' }}>
                        계산된 경력: <b id="calYear">-</b>년 <b id="calMonth">-</b>개월
                    </p>
                    <form id="totalCareerForm" method="POST" action="/mypage/mate/resume/totalCareerUpdate">
                        <div className="career-form-container">
                            <label htmlFor="careerYear" className="form-label">년<span className="fc-danger">*</span></label>
                            <input type="number" id="careerYear" name="career_year" className="form-control" min="0" max="100" placeholder="YY" />
                            <label htmlFor="careerMonth" className="form-label">개월<span className="fc-danger">*</span></label>
                            <input type="number" id="careerMonth" name="career_month" className="form-control" min="0" max="12" placeholder="MM" value="0" />
                            <button type="submit" className="btn rounded-pill pxp-section-cta">저장</button>
                        </div>
                    </form>

                    <hr />

                    {/* 프로젝트 섹션 */}
                    <h3 className="resume-title">프로젝트</h3>
                    <form >
                        <div className="project-form-container">
                            <label htmlFor="projectName" className="form-label">프로젝트명<span className="fc-danger">*</span></label>
                            <input type="text" id="projectName" name="project_name" className="form-control" placeholder="프로젝트명 입력" />
                            <label htmlFor="projectDescription" className="form-label">프로젝트 설명</label>
                            <textarea id="projectDescription" name="project_description" className="form-control" style={{ height: '100px' }}></textarea>
                            <button type="submit" className="btn rounded-pill pxp-section-cta">저장</button>
                        </div>
                    </form>
                </div>
            </div>
        </div>
    );
}

export default ResumeCreate;
